import React from 'react';
import "mdbreact/dist/css/mdb.css";
import { MDBIcon, MDBBtn,MDBCard,MDBCardTitle, MDBCardText,MDBCardImage,MDBCardBody} from 'mdbreact';
const SocialButtonsPage = () => {
    return (
        <div>
        <MDBCard style={{ width: "22rem" }}>
        <MDBCardImage className="img-fluid" src="https://mdbootstrap.com/img/Photos/Others/images/43.jpg" waves />
        <MDBCardBody>
          <MDBCardTitle>Card title</MDBCardTitle>
          <MDBCardText>
            Some quick example text to build on the card title and make
            up the bulk of the card&apos;s content.
          </MDBCardText>
          <MDBBtn href="#">MDBBtn</MDBBtn>
        </MDBCardBody>
      </MDBCard>
        <MDBBtn circle floating social="tw" size="lg">
        <MDBIcon fab icon="twitter" className="pr-1" />
      </MDBBtn>
      </div>
    );
  }

const Header = (props) => {
return( 
<div className="container">
<div className="header">
    <button type="button" class="btn btn-dark btn-circle btn-xl" onClick= {() =>props.onclick(1)}><i class="fa fa-question"></i></button> 
    <SocialButtonsPage />
</div>
</div>
) }

export default Header
